Creative Direction & Performance Art for Berlin Fashion Week.

// Fashion show and 2 day Installation showcased the magnanimous impacts of clothing waste during the height of a week in fashion that celebrates “new clothes”. The show was a slow build up of models wearing second hand clothes into “installations” ushered into position by Joshi. The setting was a black plastic floor and 80 ft backdrop which came down in the finale to reveal 2 tons of clothing waste as a statement for Vinokilo to reveal mindful consumption.

